actionConfiguration.body:
applicant => {
  switch (applicant.status) {
    case 'new':
      return 'Shortlist';
    case 'shortlisted':
      return 'Proceed to Round 1';
    case 'round1_done':
      return 'Proceed to Round 2';
    case 'round2_done':
      return 'Send Offer';
    case 'offered':
      return 'Onboard';
    default:
      return 'Error';
  }
}

